CREATE TABLE `like`
(
    `id`          bigint(20)                             NOT NULL AUTO_INCREMENT COMMENT '自增主键',
    `message_id`  bigint(20)                             NOT NULL DEFAULT '0' COMMENT '日记id',
    `ip`          varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'ip地址',
    `create_time` datetime                               NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` datetime                               NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci COMMENT ='点赞';

CREATE TABLE `message`
(
    `id`          bigint(20)                              NOT NULL AUTO_INCREMENT COMMENT '自增主键',
    `date_week`   varchar(32) COLLATE utf8mb4_unicode_ci  NOT NULL DEFAULT '' COMMENT '日期',
    `text`        varchar(512) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '文案',
    `approved`    tinyint(1)                              NOT NULL DEFAULT '0' COMMENT '审批',
    `username`    varchar(32) COLLATE utf8mb4_unicode_ci  NOT NULL DEFAULT '' COMMENT '称呼',
    `ip`          varchar(64) COLLATE utf8mb4_unicode_ci  NOT NULL DEFAULT '' COMMENT 'ip地址',
    `like_num`    int(11)                                 NOT NULL DEFAULT '0' COMMENT '点赞',
    `mood`        varchar(32) COLLATE utf8mb4_unicode_ci  NOT NULL DEFAULT '' COMMENT '心情',
    `weather`     varchar(32) COLLATE utf8mb4_unicode_ci  NOT NULL DEFAULT '' COMMENT '天气',
    `create_time` datetime                                NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` datetime                                NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_unicode_ci COMMENT ='日记';

