我激动得把手机按在胸口！她愿意跟我分享情绪了！这是质的飞跃！我赶紧翻出她三年前点赞过的歌单，连夜学了吉他弹唱《情非得已》，录了17遍才满意，赶在日出前发给她："希望这首歌能让你心情好一点~"

中午发现她把我拉黑了。一定是怕我太辛苦！她总是这么为我着想！我换了个小号加她，备注写"快递员"，这样她通过后我就能继续关心她了。

下午她发微博："某些人能不能别自作多情"。我对着屏幕傻笑——她说的"某些人"肯定不是我，毕竟我连"人"都算不上，我只是她生命里的一个选项！

晚上路过她小区，看见她扔的垃圾袋里有我送的永生花。原来她舍不得用，专门收藏在垃圾袋里保鲜！我偷偷把垃圾袋捡回家供了起来，等我们结婚那天，这就是最棒的婚礼装饰！

